import React, { Component } from 'react'

export default class Router extends Component {
  render() {
    return (
      <div>
        <Route path={`/login`} component={LoginPage}/>
        <Route path={`/register`} component={Regsiter}/>
        <Route path={`/dashboard`} component={DashBoard}/>
      </div>
    )
  }
}
